import { createContext } from "react";
import { IBrandDto } from "../Api/dto/IBrand";

interface IBrandsContext {
    changeStore: {
        setNewBrands: (newBrans: IBrandDto[]) => void,
        setBrands: (newBrans: IBrandDto[]) => void
    },
    store: {
        newBrands: IBrandDto[],
        brands: IBrandDto[]
    }
}

const PanelContext = createContext<Partial<IBrandsContext>>({})

export default PanelContext
